<template>
    <div class="container">
        <svg  class="njupticon" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="200" height="200" viewBox="0 0 200 200" fill="none"><path id="njupticon.jpg" fill-rule="evenodd" style="fill:url(#pattern0)" d="M0 200L200 200L200 0L0 0L0 200Z"></path><defs><pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1"><use transform="translate(0 0) scale(0.005 0.005) rotate(0)" xlink:href="#image0" /></pattern><image  id="image0" width="200" height="200" xlink:href="data:image/png;base64," /></defs></svg>
        <span>Log in using your campus email</span>
        <div class="input">
            <div class="inputText">
                <span style="font-size: 20px">campus email</span>
            </div>
            <input type="email" name="email" id="email-input" v-model="email">
        </div>
        <div class="input">
            <div class="inputText">
                <span style="font-size: 20px">password</span>
            </div>
            <input type="password" name="password" id="password-input" v-model="password">
        </div>
        <button type="submit" class="submit" v-on:click="login">login</button>
        <div class="toRegister">
            <a href="http://localhost:5173/register">Register</a>
        </div>
    </div>
</template>

<script setup>
import api from "../service/api.js";

import {ref} from "vue";

let email = ref();
let password = ref();
let responseContent = ref({});

async function login(){
    try {
        const response = await api.get("/login" ,{
            email:email.value,
            password:password.value
        }).then(result => {
            //通过response的then来返回请求获得的数据
            // console.log(result);
            responseContent.value = result;

            //判断如果response的error信息存在，就alert错误信息，并且重置login页面
            if (responseContent.value.error_message){
                //提示账户错误的原因❌
                alert(responseContent.value.error_message);
                email.value = null;
                password.value = null;
            }else {
                //设置通行token
                localStorage.setItem('accessToken',responseContent.value.data.accessToken)
                localStorage.setItem('refreshToken',responseContent.value.data.refreshToken)
            }
        });
    }catch (error){
        console.log(error);
    }
}
</script>
